        },
        content : "첫 번째 게시글 #해시태그 #익스프레스",
        Image: [
            {
                src:'C:\Users\dlals\OneDrive\바탕 화면',
            }
        ]
    }],
}
const reducer = (state = initalState, action) => {
    switch (action.type) {
        default: return state;
    }
}
export default reducer;
